import React, { useEffect, useState, useMemo, useRef } from "react";

//자체 컴포넌트
import MainBar from "../components/GatherRoomPageCom/MainBar";
import NaviBar from "../components/GatherRoomPageCom/NaviBar";
import PlayMap from "../components/GatherRoomPageCom/PlayMap";
import SideBar from "../components/GatherRoomPageCom/SideBar";
import AllCam from "../components/GameRoomPageCom/AllCam";

//mui 컴포넌트
import Grid from "@mui/material/Grid";
import Container from "@mui/material/Container";
import Paper from "@mui/material/Paper";

const GatherRoom = () => {
  return (
    <Container>
      <Grid container spacing={2}>
        <Grid item xs={8}>
          <Grid>
            <Paper elevation={3}>
              <MainBar />
            </Paper>
          </Grid>
          <Grid>
            <Paper elevation={3}>
              {IsGameStart ? (
                <AllCam sockADR={sockADR} client={client} />
              ) : (
                <PlayMap sockADR={sockADR} client={client} data={data} />
              )}
            </Paper>
          </Grid>
        </Grid>
        <Grid item xs={4}>
          <Grid>
            <Paper elevation={3} style={{ height: 50 }}>
              <NaviBar
                sockADR={sockADR}
                IsGameStart={IsGameStart}
                setIsGameStart={setIsGameStart}
              />
            </Paper>
          </Grid>
          <Grid>
            <Paper elevation={3}>
              <SideBar client={client} data={data} skD={skD.current} />
            </Paper>
          </Grid>
        </Grid>
      </Grid>
    </Container>
  );
};

export default GatherRoom;
